import LogItem from "./LogItem/LogItem";
import './Logs.css'

const Logs = () => {

    const logsData = [
        {
            date: new Date(2023, 6, 22, 17, 30, 15),
            desc: 'learning superset',
            time: 30
        },
        {
            date: new Date(2023, 6, 23, 12, 22, 15),
            desc: 'learning nodejs',
            time: 20
        },
        {
            date: new Date(2023, 4, 10, 9, 5, 15),
            desc: 'learning golang',
            time: 40
        }
    ]

    return <div className="Log">
            {/* <LogItem test="123" hello="{'name':'hello', age:10}" fn={()=>{console.log('hello, world')}} /> */}

            <LogItem date={new Date(2021, 6, 22, 17, 30, 15)} desc={"learning front"} time={"50"} />
            <LogItem date={new Date(2021, 7, 11, 14, 20, 15)} desc={"learning front"} time={"50"} />

         </div>
};

export default Logs;
